    <script>
        var image = document.getElementById('image');
        var cropImage = document.getElementById('crop_preview');
        var image_preview = document.getElementById('image_preview');
        var croppable = false;
        var cropper;
        $(""#alpaca-file-styled"").alpaca({
            ""data"": """",

            ""options"": {
                ""type"": ""file"",
                ""label"": ""Product Photo:"",
                ""helper"": ""Pick your product picture."",
                ""id"": ""file-styled"",
                ""name"": ""files""
            },
            ""schema"": {
                ""type"": ""string"",
                ""format"": ""uri""
            },
            ""postRender"": function (control) {
                $(""#file-styled"").uniform({
                    fileButtonClass: 'action btn bg-blue'
                });
            }
        });

        $('#file-styled').on('change', function () {
            if (this.files && this.files[0]) {
                var reader = ");
                WriteLiteral(@"new FileReader();

                reader.onload = function (e) {
                    $('#image')
                        .attr('src', e.target.result);
                    $('#crop_preview')
                        .attr('src', e.target.result);

                    //if (cropper == null) {
                        AddCropper();
                    //}
                };

                reader.readAsDataURL(this.files[0]);
                
                $('#modal_form_horizontal').modal('show');
                
            }
        });
        $(document).on('submit', 'click', function () {
            //function () {
                $.modal.close();
        });

        function AddCropper() {
            cropper = new Cropper(image, {
                aspectRatio: 1,
                viewMode: 1,
                ready: function () {
                    croppable = true;
                },
            });
        }

        function Crop() {
            var croppedCanvas");
                WriteLiteral(@";

            if (!croppable) {
                return;
            }

            // Crop
            croppedCanvas = cropper.getCroppedCanvas();

            // Show
            cropImage.src = croppedCanvas.toDataURL();
            image_preview.src = croppedCanvas.toDataURL();

        }

    </script>
